import React from "react";
import "./SlideShow.scss";

export function SlideShow() {
  return (
    <section className="slideShow">
      <div className="slideTitle"></div>
      <div className="slideDate"></div>
      <div>
        <div className="buttonOutline redPink"></div>
        <div className="buttonOutline transparent"></div>
      </div>
    </section>
  );
}
